import {Routes, Route, Link, Outlet} from 'react-router-dom';
import ProjectPage from './ProjectPage';
const projects = [
    { id: 1, title: 'Project 1', description: 'Description for Project 1' },
    { id: 2, title: 'Project 2', description: 'Description for Project 2' },
    { id: 3, title: 'Project 3', description: 'Description for Project 3' },
  ];

const ProjectList = () => {

}

const Projects = () => {
    return (
        <div className="project-feed">
            <h2>
                Projects
            </h2>

            <div>
                <div className="project-card">
                    <h3>Project 1</h3>
                    <p>Really cool stuff</p>
                    <Link to="1">Learn more</Link>
                </div>
                <div className="project-card">
                    <h3>Project 2</h3>
                    <p>Even cooler stuff</p>
                    <Link to="2">Learn more</Link>
                </div>
                <div className="project-card">
                    <h3>Project 3</h3>
                    <p>How does she do it!!</p>
                    <Link to="3">Learn more</Link>
                </div>
            </div>
            <Routes>
                <Route index element={<ProjectList projects={projects} />} />
                <Route path="1" element={<ProjectPage projectId={1} />}/>
                <Route path="2" element={<ProjectPage projectId={2} />} />
                <Route path="3" element={<ProjectPage projectId={3}/>}/>
            </Routes>
        </div>
    );
};

export default Projects;
